import React from "react";
import App from "./App";
import { ReactDOM } from "react";

function greeting(){
    return 
    const customStyle = {
        color: ' '
      };
      
      if (currentTime > 12) {
        greeting = 'afternoon';
        customStyle.color = 'red';
      } else if (currentTime < 12) {
        greeting = 'morning';
        customStyle.color = 'green';
      }
    
}


export default greeting;
